import React, { Component } from 'react';


class Imagenes extends Component{
	render(){
		return(
			<div className="claseImagen">
				<img className="claseImagen" src={props.user.UrlImagen} alt={props.user.text}/>
			</div>
		);
	}
}

export default Imagenes;
